import { Injectable } from '@angular/core';
import { Movie } from './movie.model';

@Injectable({
  providedIn: 'root'
})
export class MoviesService {
  movies: Movie[] = [{ id: 'q1', name: 'Neki film', rating: '8', comment: 'Neki kom', imageUrl: 'data:image/jpeg;base64,' },
    { id: 'q2', name: 'Jos neki film', rating: '7', comment: 'Neki kom', imageUrl: 'data:image/jpeg;base64,' }
  ];

 // constructor() { }

  getMovie(id: string) {
    return this.movies.find((m: Movie) => m.id === id);
  }
}
